from time import perf_counterfrom requests import getfrom concurrent.futures import ThreadPoolExecutorimport osos.chdir('/Users/ghost/OneDrive/Desktop/image')ImageLink = strdef downloader(image: ImageLink) -> None:    image_bytes = get(image).content    image_name = image.split('/')[-1]    with open(image_name, 'wb') as file:        file.write(image_bytes)        print(f'{image_name} yuklab olindi!')    print(image_name)urls = [    'https://cdn.pixabay.com/photo/2014/08/15/11/29/beach-418742_1280.jpg',    'https://cdn.pixabay.com/photo/2017/12/15/13/51/polynesia-3021072_640.jpg',    'https://cdn.pixabay.com/photo/2013/02/21/19/06/drink-84533_640.jpg',    'https://cdn.pixabay.com/photo/2016/03/04/19/36/beach-1236581_640.jpg',    'https://cdn.pixabay.com/photo/2017/10/10/07/48/beach-2836300_640.jpg',    'https://cdn.pixabay.com/photo/2012/02/23/08/38/rocks-15712_640.jpg']start = perf_counter()with ThreadPoolExecutor(3) as worker:    worker.map(downloader, urls)# for url in urls:#     downloader(url)end = perf_counter()print(f'Ketgan vaqt {end - start:.5f}')